import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';
import './App.css'

const HomePage = () => {
  return (
    <div style={{ backgroundColor: '#3500ff', color: 'white', height: '100vh', padding: '2rem 1rem' }}>
      <Container fluid >
        <h2 className='tex'> clman</h2>
        <Container fluid >
          <div xs={12} md={5} className="d-flex flex-column justify-content-between">
            <div>
              <h1 className="display-1 text-end fw-bold" style={{ textTransform: 'uppercase', fontSize:"8rem" ,lineHeight: '0.8', letterSpacing:"1.1,"}}>
                Studio<br />Mega<br />The<br />Brigade<br />Push<br />OnxPush<br />OnxPush<br />OnxPush<br />OnxPush<br />OnxPush<br />Onx
              </h1>
            </div>
          </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
